import './App.css';
import Todos from './components/Todos';

function App() {
  state = {
    todos: [
      {
        id: 1,
        title: 'take a shower',
        completed: true
      },
      {
        id: 2,
        title: 'do the laundry',
        completed: false
      },
      {
        id: 3,
        title: 'make breakfast',
        completed: true
      }
    ]
  }
  return (
    <div className="App">
      <h1>yo</h1>
      <Todos todos={this.state.todos} />
    </div>
  );
}

export default App;
